import styled from "styled-components";

export const Button = styled.div`
  position: fixed;
  width: 100%;
  left: 90%;
  bottom: 40px;
  height: 20px;
  font-size: 3.2rem;
  z-index: 1;
  cursor: pointer;
  color: rgba(55, 55, 55, 0.755);
  &:hover {
    color: rgba(135, 135, 135, 0.755);
  }
`;
